import React from "react";
import {Container} from 'react-bootstrap'

let Header = () => {
    return (
            <div className="header">
               <Container>
                    <div className="logo">food</div>
                    <div className="form">
                        <input type="text"/>
                        <button>search food</button>
                    </div>
               </Container>
            </div>
    )
}

export default Header
